sys_variable_value.value:
(function execute(inputs, outputs) {
  	if(inputs.status_code == '200'){
      var responseObject = JSON.parse(inputs.response_body);      
      //outputs.Payload = JSON.stringify(responseObject.response.result.output.data);
      gs.debug("=========outputs.Payload======", responseObject);
      outputs.payload = JSON.stringify(responseObject.response.result.output.data);
      //outputs.payload = responseObject.response.result.output;

    }
})(inputs, outputs);

